import React from "react"

class SlotPage extends React.Component {
    render() {
        return(
            <form>
            <label>
              Select date and duration
              <input type="date"  />
              <input type="input"  />
            </label>
            <input type="submit" value="Submit" />
          </form>
        )
    }
}
export default SlotPage
